import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css'

const Contact = () => {
  const [context, setContext] = useState(null);
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Handling Two API endpoints
    const fetchContext = axios.get('http://127.0.0.1:8000/api/my_context/');
    const fetchPosts = axios.get('http://127.0.0.1:8000/api/posts/');

    Promise.all([fetchContext, fetchPosts])
      .then(([contextResponse, postsResponse]) => {
        setContext(contextResponse.data.my_info);
        setPosts(postsResponse.data);
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;

  return (
    <div>
      <h1>Contact Page</h1>
      {context && <p className="title">{context.my_title}</p>}
      {Array.isArray(posts) && (
        <table className="dataframe">
          <thead>
            <tr>
              <th>Title</th>
              <th>Beds</th>
              <th>Facing</th>
              <th>Image_url</th>
            </tr>
          </thead>
          <tbody>
            {posts.map(post => (
              <tr key={post.id}>
                <td>{post.name}</td>
                <td>{post.Image_url}</td>
                <td>{post.comment_line}</td>
                <td>{post.perfect}</td>
                {/* <td>{post.description ? post.description : "Description coming soon"}</td> */}
              </tr>
            ))}
          </tbody>
        </table>
      )}   
    {/* Using for loop in react for  to iterate the number  */}
      <ul>
        {context.my_number.map((num, index) => (
          <li key={index}>{num}</li>  // Use <li> instead of <p> for list items
        ))}
      </ul>
    </div>
  );
};

export default Contact;
